import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const inputRange = document.querySelector('input[type="range"]');
    const ok = document.querySelector("#ok");
    console.log(ok);
    let password = "";
    const nbreOi = "01KL?NKNGVGghzgdzuyutzgyuegzeuygez";
    const si = document.querySelector(".si");
    ok.addEventListener("click", () => {
      let data = [];
      if (ok.checked) {
        let nbrePush = data.push(...nbreOi);
        console.log(data);
        for (let i = 0; i < data[Math.random() * 4]; i++) {
          password = data[Math.floor(Math.random() * Math.sqrt(16))];
          si.textContent += password;
          console.log(data[Math.floor(Math.random() * Math.sqrt(16))]);
        }
      }
    });

    let nbreInput = document.getElementById("nbreInput");
    inputRange.addEventListener("input", () => {
      nbreInput.value = this.value;
    });
  });

  return (
    <>
      <input type="range" name="" id="nbreInput" min="2" max="10" value="8" />
      <input type="text" name="" id="" value="8" readOnly />
      <input type="checkbox" name="" id="ok" />
      <label htmlFor="ok">CHECK</label>
      <h1>
        Hello guy <span className="si"></span>
      </h1>
    </>
  );
};

export default App;
